import { Switch } from '@mui/material'
import React, { useState } from 'react'
import { validate1 } from './Validate1'
import "../form/Insert.css"
import axios from 'axios'


const Login = () => {
  const [togglee,settoggle] = useState(false);
    const toggle =()=>{
        togglee ? settoggle(false):settoggle(true)
    } 

    const url="http://192.168.1.20:8070/admin/login"
    const [data,setdata] = useState({
      FullName: "",
      fatherName: "",
      motherName: "",
      F_occupation: "",
      M_occupation: "",
      email: "",
      phone: "",
      address: "",
      city: "",
      gender: "",
    })
   
 
    

    // function submit(e){
    //   e.preventDefault();
    //   axios.post(url,{
    //     FullName: data.FullName,
    //     fatherName:data.fatherName,
    //     motherName:data.motherName,
    //     F_occupation:data.F_occupation,
    //     M_occupation:data.M_occupation,
    //     email:data.email,
    //     phone:data.phone,
    //     address:data.address,
    //     city:data.city,
    //     gender:data.gender
    //   })
    //   .then(res=>{
    //     console.log(res.data)
    //   })
    // }



    function handle(e){
       const newdata={...data}
       newdata[e.target.id] = e.target.value
       setdata(newdata)
       console.log(newdata)
    }
  return (
    <>
  <div className='main_div'>
                <div className="main">
                    <div className="box">
                        <h3>Insert Record</h3>
                        <form method="" action="" name='test_form'>
                            <label>Student Name<span>*</span></label>
                            <input type="text" name='stud_name' autoComplete='off'  onChange={(e)=>handle(e)}  ></input>
                            <label>Father name<span>*</span></label>
                            <input type="text"  name='father_name' autoComplete='off'  onChange={(e)=>handle(e)} value={data.fatherName}></input>
                            <label>Mother Name<span>*</span></label>
                            <input type="text"  name='mother_name' autoComplete='off' onChange={(e)=>handle(e)}  value={data.motherName}></input>
                            <label>Father occupation<span>*</span></label>
                            <input type="text" name='foccu' autoComplete='off'  onChange={(e)=>handle(e)} value={data.F_occupation}></input>
                            <label>Mother occupation<span>*</span></label>
                            <input type="text"  name='moccu' autoComplete='off'  onChange={(e)=>handle(e)} value={data.M_occupation}></input>
                            <label>Email<span>*</span></label>
                            <input type="text" name='email' autoComplete='off' onChange={(e)=>handle(e)} value={data.email}></input>
                            <label>Mobile number<span>*</span></label>
                            <input type="text"  name='mobile' autoComplete='off' onChange={(e)=>handle(e)} value={data.phone} ></input>
                            <label>Fees</label>
                            <div style={{backgroundColor:"white",width:"60px"}}><Switch  onClick={toggle} /></div>
                            <label>Address</label>
                            <textarea rows=" " cols=""  onChange={(e)=>handle(e)} value={data.address}> </textarea>
                            <label>City<span>*</span></label>
                            <input type="text"  name='city' autoComplete='off' onChange={(e)=>handle(e)}  value={data.city } ></input>
                            <label >Gender:</label>
                            <select name="gender"  onChange={(e)=>handle(e)}  value={data.gender}>
                                <option value="male">Male</option>
                                <option value="Female">Female</option>
                            </select>
                            <button className="btn" onClick={validate1}> submit</button>
                        </form>
                    </div>
                </div>

            </div>
   


    </>
  )
}

export default Login
